  NoteField get syncId {
    return _syncId = setField(_syncId, 'syncId', DbType.text);
  }

  NoteField _favourite;
  NoteField get favourite {
    return _favourite = setField(_favourite, 'favourite', DbType.bool);
  }

  NoteField _createdAt;
  NoteField get createdAt {
    return _createdAt = setField(_createdAt, 'createdAt', DbType.datetime);
  }

  NoteField _updatedAt;
  NoteField get updatedAt {
    return _updatedAt = setField(_updatedAt, 'updatedAt', DbType.datetime);
  }

  NoteField _isDeleted;
  NoteField get isDeleted {
    return _isDeleted = setField(_isDeleted, 'isDeleted', DbType.bool);
  }

  bool _getIsDeleted;

  void _buildParameters() {
    if (_page > 0 && _pagesize > 0) {
      qparams
        ..limit = _pagesize
        ..offset = (_page - 1) * _pagesize;
    } else {
      qparams
        ..limit = _pagesize
        ..offset = _page;
    }
    for (DbParameter param in parameters) {
      if (param.columnName != null) {
        if (param.value is List) {
          param.value = param.value
              .toString()
              .replaceAll('[', '')
              .replaceAll(']', '')
              .toString();
          whereString += param.whereString
              .replaceAll('{field}', param.columnName)
              .replaceAll('?', param.value.toString());
          param.value = null;
        } else {
          whereString +=
              param.whereString.replaceAll('{field}', param.columnName);
        }
        if (!param.whereString.contains('?')) {
        } else {
          switch (param.dbType) {
            case DbType.bool:
              param.value =
                  param.value == null ? null : param.value == true ? 1 : 0;
              param.value2 =
                  param.value2 == null ? null : param.value2 == true ? 1 : 0;
              break;
            case DbType.date:
            case DbType.datetime:
              param.value = param.value == null
                  ? null
                  : (param.value as DateTime).millisecondsSinceEpoch;
              param.value2 = param.value2 == null
                  ? null
                  : (param.value2 as DateTime).millisecondsSinceEpoch;
              break;
            default:
          }
          if (param.value != null) {
            whereArguments.add(param.value);
          }
          if (param.value2 != null) {
            whereArguments.add(param.value2);
          }
        }
      } else {
        whereString += param.whereString;
      }
    }
    if (Note._softDeleteActivated) {
      if (whereString != '') {
        whereString =
            '${!_getIsDeleted ? 'ifnull(isDeleted,0)=0 AND' : ''} ($whereString)';
      } else if (!_getIsDeleted) {
        whereString = 'ifnull(isDeleted,0)=0';
      }
    }

    if (whereString != '') {
      qparams.whereString = whereString;
    }
    qparams
      ..whereArguments = whereArguments
      ..groupBy = groupByList.join(',')
      ..orderBy = orderByList.join(',');
  }

  /// Deletes List<Note> bulk by query
  ///
  /// <returns>BoolResult res.success=Deleted, not res.success=Can not deleted
  Future<BoolResult> delete([bool hardDelete = false]) async {
    _buildParameters();
    var r = BoolResult();
    if (Note._softDeleteActivated && !hardDelete) {
      r = await _obj._mnNote.updateBatch(qparams, {'isDeleted': 1});
    } else {
      r = await _obj._mnNote.delete(qparams);
    }
    return r;
  }

  Future<BoolResult> recover() async {
    _getIsDeleted = true;
    _buildParameters();
    print('SQFENTITIY: recover Note bulk invoked');
    return _obj._mnNote.updateBatch(qparams, {'isDeleted': 0});
  }

  /// using:
  ///
  /// update({'fieldName': Value})
  ///
  /// fieldName must be String. Value is dynamic, it can be any of the (int, bool, String.. )
  Future<BoolResult> update(Map<String, dynamic> values) {
    _buildParameters();
    if (qparams.limit > 0 || qparams.offset > 0) {
      qparams.whereString =
          'id IN (SELECT id from notes ${qparams.whereString.isNotEmpty ? 'WHERE ${qparams.whereString}' : ''}${qparams.limit > 0 ? ' LIMIT ${qparams.limit}' : ''}${qparams.offset > 0 ? ' OFFSET ${qparams.offset}' : ''})';
    }
    return _obj._mnNote.updateBatch(qparams, values);
  }

  /// This method always returns NoteObj if exist, otherwise returns null
  /// <returns>List<Note>
  Future<Note> toSingle([VoidCallback Function(Note o) note]) async {
    _pagesize = 1;
    _buildParameters();
    final objFuture = _obj._mnNote.toList(qparams);
    final data = await objFuture;
    Note obj;
    if (data.isNotEmpty) {
      obj = Note.fromMap(data[0] as Map<String, dynamic>);
    } else {
      obj = null;
    }
    if (note != null) {
      note(obj);
    }
    return obj;
  }

  /// This method always returns int.
  ///
  /// <returns>int
  Future<int> toCount([VoidCallback Function(int c) noteCount]) async {
    _buildParameters();
    qparams.selectColumns = ['COUNT(1) AS CNT'];
    final notesFuture = await _obj._mnNote.toList(qparams);
    final int count = notesFuture[0]['CNT'] as int;
    if (noteCount != null) {
      noteCount(count);
    }
    return count;
  }

  /// This method always returns List<Note>.
  /// <returns>List<Note>
  Future<List<Note>> toList(
      [VoidCallback Function(List<Note> o) noteList]) async {
    final data = await toMapList();
    final List<Note> notesData = await Note.fromMapList(data);
    if (noteList != null) noteList(notesData);
    return notesData;
  }

  /// This method always returns Json String
  Future<String> toJson() async {
    final list = <dynamic>[];
    final data = await toList();
    for (var o in data) {
      list.add(o.toMap(forJson: true));
    }
    return json.encode(list);
  }

  /// This method always returns Json String.
  Future<String> toJsonWithChilds() async {
    final list = <dynamic>[];
    final data = await toList();
    for (var o in data) {
      list.add(await o.toMapWithChilds(false, true));
    }
    return json.encode(list);
  }

  /// This method always returns List<dynamic>.
  ///
  /// <returns>List<dynamic>
  Future<List<dynamic>> toMapList() async {
    _buildParameters();
    return await _obj._mnNote.toList(qparams);
  }

  /// Returns List<DropdownMenuItem<Note>>
  Future<List<DropdownMenuItem<Note>>> toDropDownMenu(String displayTextColumn,
      [VoidCallback Function(List<DropdownMenuItem<Note>> o)
          dropDownMenu]) async {
    _buildParameters();
    final notesFuture = _obj._mnNote.toList(qparams);

    final data = await notesFuture;
    final int count = data.length;
    final List<DropdownMenuItem<Note>> items = []..add(DropdownMenuItem(
        value: Note(),
        child: Text('Select Note'),
      ));
    for (int i = 0; i < count; i++) {
      items.add(
        DropdownMenuItem(
          value: Note.fromMap(data[i] as Map<String, dynamic>),
          child: Text(data[i][displayTextColumn].toString()),
        ),
      );
    }
    if (dropDownMenu != null) {
      dropDownMenu(items);
    }
    return items;
  }

  /// Returns List<DropdownMenuItem<int>>
  Future<List<DropdownMenuItem<int>>> toDropDownMenuInt(
      String displayTextColumn,
      [VoidCallback Function(List<DropdownMenuItem<int>> o)
          dropDownMenu]) async {
    _buildParameters();
    qparams.selectColumns = ['id', displayTextColumn];
    final notesFuture = _obj._mnNote.toList(qparams);

    final data = await notesFuture;
    final int count = data.length;
    final List<DropdownMenuItem<int>> items = []..add(DropdownMenuItem(
        value: 0,
        child: Text('Select Note'),
      ));
    for (int i = 0; i < count; i++) {
      items.add(
